  methods: {
    // 处理拖拽开始
    handleDragstart: function handleDragstart(e) {
      this.offsetX = e.offsetX;
      this.offsetY = e.offsetY;
    },
    // 处理拖拽结束
    handleDragEnd: function handleDragEnd(e, item) {
      var data = {};
      Object.assign(data, item);
      data.offsetX = this.offsetX;
      data.offsetY = this.offsetY;

      if (this.page) {
        var graph = this.page.graph; // const size = e.target.dataset.size.split("*");

        var xy = graph.getPointByClient(e.x, e.y);
        data.x = xy.x;
        data.y = xy.y;
        data.size = item.size.split("*");
        data.type = "node";
        this.command.executeCommand("add", [data]); // 加入节点！！

        console.log(data);
      }
    },
    bindEvent: function bindEvent() {
      var _this = this;

      eventBus.$on("afterAddPage", function (page) {
        _this.page = page;
        _this.command = page.command;
      });
    }
  }
